from collections import deque

class MyStack:
    def __init__(self):
        self.queue = deque()

    def push(self, x):
        self.queue.append(x)
        for _ in range(len(self.queue) - 1):
            self.queue.append(self.queue.popleft())

    def pop(self):
        return self.queue.popleft()

    def top(self):
        return self.queue[0]

    def empty(self):
        return len(self.queue) == 0

def runMyStack(operations, values):
    obj = None
    results = []

    for i, op in enumerate(operations):
        if op == "MyStack":
            obj = MyStack()
            results.append(None)
        elif op == "push":
            obj.push(values[i][0])
            results.append(None)
        elif op == "pop":
            results.append(obj.pop())
        elif op == "top":
            results.append(obj.top())
        elif op == "empty":
            results.append(obj.empty())

    return results

